// Output array
const results = [];

for (let i = 0; i < items.length; i++) {

  // Parse AI JSON from current item
  const ai = JSON.parse(items[i].json.output[0].content[0].text);

  // Build merged result
  results.push({
    username: $item(i).$node["Lead Keyword Filter"].json.username,
    source: $item(i).$node["Lead Keyword Filter"].json.source,
    summary: ai.summary,
    category: ai.category,
    timestamp: new Date().toISOString()
  });
}

return results;

const leads = items.map(i => i.json);

return [
  {
    json: {
      totalLeads: leads.length,
      bySource: leads.reduce((acc, lead) => {
        acc[lead.source] = (acc[lead.source] || 0) + 1;
        return acc;
      }, {}),
      byCategory: leads.reduce((acc, lead) => {
        acc[lead.category] = (acc[lead.category] || 0) + 1;
        return acc;
      }, {}),
      exampleLeads: leads.slice(0, 5) // first 5 example leads
    }
  }
];

// Loop over input items and add a new field called 'myNewField' to the JSON of each one
// Get the full array of incoming data from the webhook body
const input = $input.first().json.body;

// Ensure input is an array
if (!Array.isArray(input)) {
  return [];
}

// Keywords to match
const keywords = [
  "social media",
  "send info",
  "ad request",
  "promo request",
  "collaboration",
  "partnership",
  "work together"
];

// Filter leads that mention ANY keyword
const filteredLeads = input.filter(item => {
  if (!item.message) return false;

  const msg = item.message.toLowerCase();
  return keywords.some(keyword => msg.includes(keyword.toLowerCase()));
});

// Map the filtered leads to clean objects
const leads = filteredLeads.map(item => ({
  json: {
    username: item.username || null,
    source: item.source || "unknown",
    message: item.message || "",
    receivedAt: new Date().toISOString(),
  },
}));

// Return the filtered and cleaned leads
return leads;

const itemsOut = [];
const now = new Date();

// normalize today's date to midnight
const todayStart = new Date(now.getFullYear(), now.getMonth(), now.getDate());
const todayEnd = new Date(now.getFullYear(), now.getMonth(), now.getDate() + 1);

for (const item of items) {
  const lead = item.json;

  // Try both timestamp fields
  const leadDate = new Date(lead.timestamp || lead.recievdAt);

  // If lead date is today
  if (leadDate >= todayStart && leadDate < todayEnd) {
    itemsOut.push(item);
  }
}

return itemsOut;

